import React from 'react';
import { User, CheckCircle, Clock, AlertCircle, Activity, Zap } from 'lucide-react';

const AgentCard = ({ agent, onViewActivity }) => {
  const getStatusIcon = (status) => {
    switch (status) {
      case 'ready':
        return <CheckCircle className="w-5 h-5 text-success-500" />;
      case 'busy':
        return <Activity className="w-5 h-5 text-warning-500 animate-pulse" />;
      case 'error':
        return <AlertCircle className="w-5 h-5 text-error-500" />;
      default:
        return <CheckCircle className="w-5 h-5 text-gray-400" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'ready':
        return 'bg-success-50 text-success-700 border-success-200';
      case 'busy':
        return 'bg-warning-50 text-warning-700 border-warning-200';
      case 'error':
        return 'bg-error-50 text-error-700 border-error-200';
      default:
        return 'bg-gray-50 text-gray-700 border-gray-200';
    }
  };

  const getAgentIcon = (agentName) => {
    const icons = {
      'orchestration_coordinator': 'ðŸŽ¯',
      'task_allocation_manager': 'ðŸ“Š',
      'research_intelligence_agent': 'ðŸ”',
      'data_processing_specialist': 'âš™ï¸',
      'execution_monitor': 'ðŸ“ˆ',
      'quality_assurance_specialist': 'âœ…'
    };
    return icons[agentName] || 'ðŸ¤–';
  };

  const formatLastActivity = (timestamp) => {
    if (!timestamp) return 'Never';
    const now = new Date();
    const lastActivity = new Date(timestamp);
    const diffMs = now - lastActivity;
    const diffMins = Math.floor(diffMs / 60000);

    if (diffMins < 1) return 'Just now';
    if (diffMins < 60) return `${diffMins}m ago`;
    const diffHours = Math.floor(diffMins / 60);
    if (diffHours < 24) return `${diffHours}h ago`;
    return lastActivity.toLocaleDateString();
  };

  return (
    <div className="bg-white rounded-lg border border-gray-200 p-4 hover:shadow-md transition-all duration-200 group">
      <div className="flex items-start justify-between">
        <div className="flex items-center space-x-3">
          <div className="flex items-center justify-center w-12 h-12 bg-primary-100 rounded-lg text-xl">
            {getAgentIcon(agent.name)}
          </div>
          <div>
            <h3 className="font-medium text-gray-900">{agent.role}</h3>
            <p className="text-sm text-gray-500 capitalize">
              {agent.name.replace(/_/g, ' ')}
            </p>
          </div>
        </div>

        <div className="flex items-center space-x-2">
          {getStatusIcon(agent.status)}
          {agent.status === 'busy' && (
            <button
              onClick={() => onViewActivity && onViewActivity(agent)}
              className="p-1 text-primary-500 hover:text-primary-700 transition-colors opacity-0 group-hover:opacity-100"
              title="View live activity"
            >
              <Zap className="w-4 h-4" />
            </button>
          )}
        </div>
      </div>

      <div className="mt-4 space-y-3">
        <div className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium border ${getStatusColor(agent.status)}`}>
          {agent.status.charAt(0).toUpperCase() + agent.status.slice(1)}
        </div>

        {agent.current_task && (
          <div className="p-2 bg-primary-50 rounded border border-primary-200">
            <p className="text-xs text-primary-700 font-medium mb-1">Current Task:</p>
            <p className="text-xs text-primary-600 line-clamp-2">
              {agent.current_task}
            </p>
          </div>
        )}

        <div className="flex items-center justify-between text-xs text-gray-500">
          <div className="flex items-center space-x-4">
            <div>
              <span className="font-medium">Completed:</span>
              <span className="ml-1 text-primary-600 font-semibold">
                {agent.total_tasks_completed || 0}
              </span>
            </div>
          </div>

          <div>
            <span className="font-medium">Last active:</span>
            <span className="ml-1">
              {formatLastActivity(agent.last_activity)}
            </span>
          </div>
        </div>

        {agent.status === 'busy' && (
          <div className="mt-2">
            <div className="flex items-center space-x-2 mb-1">
              <Activity className="w-3 h-3 text-warning-500 animate-pulse" />
              <span className="text-xs font-medium text-warning-700">Processing...</span>
            </div>
            <div className="w-full bg-warning-200 rounded-full h-1">
              <div className="bg-warning-500 h-1 rounded-full animate-pulse" style={{ width: '60%' }}></div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default AgentCard;
